import React, {Component} from "react";
import BookCard from "./BookCard";
import Slider from "react-slick";
import "../carousel/slick.css"; 
import "../carousel/slick-theme.css";
import "./bookCardsList.css";

export default function BookCardsList(db) {
    db.push({
            "id":3,
            "username": "admin",
            "firstName": "Admin",
            "lastName": "Admin",
            "email": "admin@gmail.com",
            "password": "admin123"
        },
    );
    console.log(db);
    const BookElements = db.bookElements.map(book => {
       return <BookCard key={book.books_id} bookItem={book} />
    })

    const settings = {
            dots: false,
            arrows:true,
            infinite: true,
            slidesToShow: 4,
            slidesToScroll: 4,       
          };


    return (
        <div className="book-elements">
            <Slider {...settings}>
                {BookElements}
            </Slider>    
        </div>
    );

}
